      "text": "1. Ein Stichlein von in circa 20. Caum extra schön und guter rother Marggräfin / Wein von An- no 1728. in raffinabtem Freyß. 2. Zwei Winterhauten zur Rauhen allhier / sampt Ketterweber / allsahm Ochsen- und Haupthaut / auch all ubriger Gerechtigkeit in billigem Preiß / und haben die Herren Liebhaber in dem Adress- Commerz Schreiber. 3. Ein Eiend Hau von ungefähr 2. Bäggen / von feister Recolte, / sehr gut und ohrberegnet / in rai- sonablem Preiß. Eigt aber nicht hier. 4. Zwei Cuckelien von besten weißen Marggräfin / für 20. Caum de Anno 1728. und ein biss von ge- meinem Jahrgang / zweier Cäffel / sehr fein und vom besten Orts / in moderatem Preiß. 5. Eine jümlisch wohl / conditionierte Violino di Cam- ba, so im Adress-Commerz fan gefunden werden. 6. Zwei Herren Burschhüte / zur Linien ist zu haben / Extra guter Wässerstall- und Langewässer-Wein die Bouteille à 7 ½. Bägen. 7. Ein grosses Hult / Daran drey Personen zugleich / jgen und feinere Cämen / sampt darzu gehö- rigen Lich. 8. Ein grosser Himmel-Beut mit einer bepsam- men Rahmen von Weiß. 9. Ein schöner Hau- / schlitzen sampt dem Geschirr. 10. Ein extra feiner Schier- / Schreiber. 11. Ein halb Duxing Franksche Eielf / von grü- ner Moquette, / sowon im Adress-Commerz ein Wüster zu sehn ist. 12. Zwei Stück Lagers von rother Moquette / zu Ausrüstung einer Zimmer mit mittelmäßiger Größe, / leid auch im Adress-Commerz zu sehn. 13. Ein eigner Bräher mittelmäßiger Größe. 14. Guter alter Kand- / Honig, die Maß à 6. Bägen. 15. Ein extra äußerer Lavon oder Eielfsch von Ein- glichen Zim / / auf die neue Mode. 16. Eine fehr artig und wohl-gefärtigte liebste Berliner. 17. Eine brave Chaue / auf vier Räderen. 18. Eine brave Behaupung von vorerstlicher Situation. 19. Eine mit Silber geartete fünfte Caune neuweil. 20. Zwei feine Zämer / feiglich per Jüngstens. 21. Zweiere Zimmer / Dachten zum Kolbenkraug /"
